const QuestionsList = [
    {
        question: "Jack Rabbit stated that the fire became bigger than what United States city?",
        answerList: [
            {id: "1", text: "New York", correct: true},
            {id: "2", text: "Vancouver"},
            {id: "3", text: "Toronto"},
            {id: "4", text: "London"}
            
        ],
    },
    {
        question: "What animal was the Prime Minister?",
        answerList: [
            {id: "1", text: "Crocodile"},
            {id: "2", text: "An owl"},
            {id: "3", text: "A beaver", correct: true},
            {id: "4", text: "A fish"},
            
        ]
    },

]

export default QuestionsList;
